script: |
  super -f text -I q2023.spq | sort > q2023.out

inputs:
  - name: q2023.spq
    data: |
      SELECT DISTINCT col2 * + col2 FROM tab2 (FORMAT parquet) WHERE col0 * col1 - col1 * + col0 NOT BETWEEN + col2 + - col0 * + col1 AND + col0 * col2 + col1;
  - name: tab2

outputs:
  - name: q2023.out
    data: |
